    false,nt"url": null,nt"notes": "White paper on the history of fish collections
    in the Niobrara River basin, from 1893 to 2005.  This paper discusses locations
    of previous fish sampling, and locations requiring more collecting and information
    on fish species inhibiting the stream reach or lake.  The history of fish sampling
    and collecting within the Niobrara River basin is discussed, as well as fish species
    and occurrence in rivers, streams, lakes, and ponds. Recommendations for future
    stream reaches that require more sampling are provided. Extensive maps of sampling
    locations, fish species occurrences, and information on native and introduced fish
    species follows the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
